import './Notifications.css';
import {getLastestNotification} from './utils';
import closeIcon from'./images/close-icon.png';
function Notifications() {
  return (
    <div className="Notifications">
      <p>Here is the list of notifications</p>
      <button type="button" style={
        {
          height: '25px',
          width: '25px',
          display: 'flex', 
          justifyContent: 'center',
          cursor: 'pointer',
          alignItems: 'center'
        }} onClick={() => { console.log('Close button has been clicked')}} aria-label='Close'>
        <img src={closeIcon} alt="" style={
        {
          height: '100%',
          width: 'auto',
          margin: 'auto'

        }} />
      </button>
      <ul>
        <li>New course available</li>
        <li>New resume available</li>
        <li dangerouslySetInnerHTML={{__html: getLastestNotification()}} />
      </ul>
    </div>
  )
}

export default Notifications;
